    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,60.3681,715.1083)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text262"><tspan
         
         y="0"
         id="tspan244">PzNordic mellem Kongens Have og Botanisk Have </tspan><tspan
         
         y="12.996"
         id="tspan246">kombinerer det bedste fra to madtraditioner, nemlig </tspan><tspan
         
         y="25.992001"
         id="tspan248">den italienske og den nordiske. De to ejere, Davide </tspan><tspan
         
         y="38.987999"
         id="tspan250">Maganuco og Morten Frydensdal, brænder for </tspan><tspan
         
         y="51.984001"
         id="tspan252">gourmetpizza, der skifter alt efter, hvilken farve </tspan><tspan
         
         y="64.980003"
         id="tspan254">sæsonens blade har ude på træerne.</tspan><tspan
         
         y="77.975998"
         id="tspan256">Forvent ingredienser som østershattepuré, brændt </tspan><tspan
         
         y="90.972"
         id="tspan258">porrestøv og syltede rabarber. Sådan har du sikkert </tspan><tspan
         
         y="103.968"
         id="tspan260">ikke fået din pizza før.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,323.9902,743.939)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"

    <text
       xml:space="preserve"

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,323.9902,715.1083)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text276"><tspan
         
         y="0"
         id="tspan272">Bæst laver et, ja bæst af en pizza. Sådan må det </tspan><tspan
         
         y="12.996"
         id="tspan274">jo naturligvis være, når ejeren af den 1.000 m</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,527.7961,704.4143)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:7px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text280"><tspan
         
         y="0"

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,323.9896,689.1083)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text296"><tspan
         
         y="0"
         id="tspan282">store restaurant hedder Christian Puglisi. Med sine </tspan><tspan
         
         y="12.996"
         id="tspan284">italienske rødder har han en stolthed over for </tspan><tspan
         
         y="25.992001"
         id="tspan286">råvarerne som få andre i verden. Ja, i verden. Bæsts </tspan><tspan
         
         y="38.987999"
         id="tspan288">pizza er flere gange stemt ind som en af verdens </tspan><tspan
         
         y="51.984001"
         id="tspan290">10 bedste pizzaer. Deres grillede bund giver den </tspan><tspan
         
         y="64.980003"
         id="tspan292">bedste base for deres egenproducerede råvarer som </tspan><tspan
         
         y="77.975998"
         id="tspan294">charcuteri og oste.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,60.3681,576.5925)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text300"><tspan
         
         y="0"
         id="tspan298">Forno a Legna</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,60.3681,560.7579)"
       style="font-style:italic;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Italic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text304"><tspan
         
         y="0"
         id="tspan302">Falkoner Allé 42, 2000 Frederiksberg</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,60.3681,547.7619)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text320"><tspan
         
         y="0"
         id="tspan306">Hos Forno a Legna på Frederiksberg har de </tspan><tspan
         
         y="12.996"
         id="tspan308">specialiseret sig i de hvide pizzaer. Det betyder, at </tspan><tspan
         
         y="25.992001"
         id="tspan310">man kan få sin yndlingsspise uden den traditionelle </tspan><tspan
         
         y="38.987999"
         id="tspan312">tomatsauce, som ellers udgør bunden i mange </tspan><tspan
         
         y="51.984001"
         id="tspan314">pizzaer. Bunden er sprød og knasende, og der er et </tspan><tspan
         
         y="64.980003"
         id="tspan316">utal af italienske delikatesser, som man kan vælge </tspan><tspan
         
         y="77.975998"
         id="tspan318">som topping.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,323.9902,576.5925)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text324"><tspan
         
         y="0"
         id="tspan322">Frankies Pizza Nørrebro</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,323.9902,560.7579)"
       style="font-style:italic;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Italic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text328"><tspan
         
         y="0"
         id="tspan326">Sortedam Dossering 5, 2200 København N</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,323.9902,547.7619)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text344"><tspan
         
         y="0"
         id="tspan330">Madklubben vil også være med på det italienske.</tspan><tspan
         
         y="12.996"
         id="tspan332">Deres mest brugte våben er de Valoriani-pizzaovne, </tspan><tspan
         
         y="25.992001"
         id="tspan334">de har fået installeret, og som bager den ene </tspan><tspan
         
         y="38.987999"
         id="tspan336">sprøde, halvrøgede pizzabund efter den anden – </tspan><tspan
         
         y="51.984001"
         id="tspan338">efter blot et minuts tid under varmen.</tspan><tspan
         
         y="64.980003"
         id="tspan340">Med udsigt direkte over Søerne er der også noget </tspan><tspan
         
         y="77.975998"
         id="tspan342">for øjnene herinde. </tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,60.3681,435.2461)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text348"><tspan
         
         y="0"
         id="tspan346">Mother</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,60.3681,419.4114)"
       style="font-style:italic;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Italic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text352"><tspan
         
         y="0"
         id="tspan350">Høkerboderne 9-15, 1712 København V</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,60.3681,406.4154)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text374"><tspan
         
         y="0"
         id="tspan354">Mother i Kødbyen er et af byens sikreste kort, hvis </tspan><tspan
         
         y="12.996"
         id="tspan356">du vil smage den italienske nationalspise. Bunden er </tspan><tspan
         
         y="25.992001"
         id="tspan358">fremelsket af surdej, hvilket selvfølgelig kan smages. </tspan><tspan
         
         y="38.987999"
         id="tspan360">Når man arbejder med surdej, er der altid en </tspan><tspan
         
         y="51.984001"
         id="tspan362">moder-surdej, og det er faktisk her, navnet Mother </tspan><tspan
         
         y="64.980003"
         id="tspan364">er hentet fra. Ejer David Biffani har siden første </tspan><tspan
         
         y="77.975998"
         id="tspan366">åbningsdag haft næsten fuldt hus, og folk flokkes </tspan><tspan
         
         y="90.972"
         id="tspan368">ikke blot om de populære pizzaer, men nyder også </tspan><tspan
         
         y="103.968"
         id="tspan370">godt af de rå omgivelser i Kødbyen, hvor man også </tspan><tspan
         
         y="116.964"
         id="tspan372">kan sidde udenfor på de mange bænke.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,323.9902,435.2461)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text378"><tspan
         
         y="0"
         id="tspan376">Behov – en spisebutik</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,323.9902,419.4114)"
       style="font-style:italic;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Italic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text382"><tspan
         
         y="0"
         id="tspan380">Rentemestervej 94, 2400 København NV</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,323.9902,406.4154)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text404"><tspan
         
         y="0"
         id="tspan384">Alle har vel egentlig behov for pizza. Ude i Nordvest </tspan><tspan
         
         y="12.996"
         id="tspan386">så meget, at de har opkaldt deres biks efter det. Her </tspan><tspan
         
         y="25.992001"
         id="tspan388">kan man endda samle-sin-egen-pizza, og det er lige </tspan><tspan
         
         y="38.987999"
         id="tspan390">meget, hvor mange toppings man smider på, prisen </tspan><tspan
         
         y="51.984001"
         id="tspan392">er den samme.</tspan><tspan
         
         y="64.980003"
         id="tspan394">Som med et hus starter man fra bunden med at </tspan><tspan
         
         y="77.975998"
         id="tspan396">vælge dej: klassisk, fuldkorn eller glutenfri. Så skal </tspan><tspan
         
         y="90.972"
         id="tspan398">der tages stilling til rød, hvid eller grøn sauce og </tspan><tspan
         
         y="103.968"
         id="tspan400">dernæst osten, inden man har frit valg i ingrediens-</tspan><tspan
         
         y="116.964"
         id="tspan402">tombolaen.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,60.3681,252.065)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text408"><tspan
         
         y="0"
         id="tspan406">Hos Fischer</tspan></text>
    <text

         id="tspan410">Victor Borges Plads 12, 2100 København Ø</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,60.3681,223.2343)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text436"><tspan
         
         y="0"
         id="tspan414">Hos Fischer er drevet af David Fischer. Fischer har </tspan><tspan
         
         y="12.996"
         id="tspan416">arbejdet på L’Arpège i Paris og et par år på Roms </tspan><tspan
         
         y="25.992001"
         id="tspan418">eneste trestjernede Michelin-restaurant, La Pergola, </tspan><tspan
         
         y="38.987999"
         id="tspan420">inden han åbnede Hos Fischer på Victor Borges Plads. </tspan><tspan
         
         y="51.984001"
         id="tspan422">I 2019 gik han all in på pizza. Den romerske af </tspan><tspan
         
         y="64.980003"
         id="tspan424">slagsen – den med en ultratynd og knasende bund. </tspan><tspan
         
         y="77.975998"
         id="tspan426">Det kan i dén grad smages, at Fischer har inde på </tspan><tspan
         
         y="90.972"
         id="tspan428">rygraden, at enkle, men suveræne råvarer gør hele </tspan><tspan
         
         y="103.968"
         id="tspan430">forskellen.</tspan><tspan
         
         y="116.964"
         id="tspan432">Hos Fischer har altid 4-6 forskellige pizzaer på </tspan><tspan
         
         y="129.96001"
         id="tspan434">menuen, og de koster 100,- kr.</tspan></text>
    <text
       xml:space="preserve"

    <text

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,323.9902,223.2343)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text462"><tspan
         
         y="0"
         id="tspan446">Tribeca i Nordvest er intet mindre end et decideret </tspan><tspan
         
         y="12.996"
         id="tspan448">pizza- og øl-laboratorium, der har specialiseret sig </tspan><tspan
         
         y="25.992001"
         id="tspan450">i siciliansk stenovnspizza. De udvikler konstant nye </tspan><tspan
         
         y="38.987999"
         id="tspan452">smagssammensætninger, men altid med økologiske </tspan><tspan
         
         y="51.984001"
         id="tspan454">råvarer. Tomat og mozzarella er faste ingredienser </tspan><tspan
         
         y="64.980003"
         id="tspan456">på menukortet, men der er også altid plads til </tspan><tspan
         
         y="77.975998"
         id="tspan458">eksotiske ingredienser som ’nduja (stærk, smørbar </tspan><tspan
         
         y="90.972"
         id="tspan460">italiensk pølse), gedeost, asparges og artiskokcreme.</tspan></text>

    <path
       d="M 65.912,753.858 H 314.861 V 541.26 H 65.912 Z m 0,-228.227 H 314.861 V 313.033 H 65.912 Z m 0,-229.319 H 314.861 V 83.714 H 65.912 Z"

    <text
       xml:space="preserve"

       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text46"><tspan
         
         y="0"
         id="tspan44">Feriehus nr. 111</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,74.416,720.5197)"
       style="font-style:italic;font-variant:normal;font-weight:bold;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-BoldItalic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text50"><tspan
         
         y="0"
         id="tspan48">Bjerregård Strand</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,74.416,707.5237)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text78"><tspan
         
         y="0"
         id="tspan52">Spændende feriehus med en stor indendørs </tspan><tspan
         
         y="12.996"
         id="tspan54">swimmingpool og en betagende udsigt ud over </tspan><tspan
         
         y="25.992001"
         id="tspan56">heden og klitterne ved Vesterhavet. Husets dejlige </tspan><tspan
         
         y="38.987999"
         id="tspan58">indretning med bl.a. gode soveværelser, hyggeligt </tspan><tspan
         
         y="51.984001"
         id="tspan60">køkken-alrum med brændeovn, spabad og sauna </tspan><tspan
         
         y="64.980003"
         id="tspan62">danner rammen om en god og afslappende ferie. </tspan><tspan
         
         y="77.975998"
         id="tspan64">Stranden ligger kun 400 m borte. Besøg området, </tspan><tspan
         
         y="90.972"
         id="tspan66">bl.a. Hvide Sande med fiskerihavn med mulighed </tspan><tspan
         
         y="103.968"
         id="tspan68">for vandski, surfing og fiskeri, eller Bork Havn </tspan><tspan
         
         y="116.964"
         id="tspan70">med en hyggelig fjordhavn og et spændende </tspan><tspan
         
         y="129.96001"
         id="tspan72">vikingemuseum. Her er det perfekte feriehus, hvor </tspan><tspan
         
         y="142.95599"
         id="tspan74">husdyr også er velkomne, i et skønt område for den </tspan><tspan
         
         y="155.952"
         id="tspan76">perfekte ferie. </tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,74.416,508.127)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text82"><tspan
         
         y="0"
         id="tspan80">Feriehus nr. 112</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,74.416,492.2923)"
       style="font-style:italic;font-variant:normal;font-weight:bold;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-BoldItalic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text86"><tspan
         
         y="0"
         id="tspan84">Blåvand</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,74.416,479.2963)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text114"><tspan
         
         y="0"
         id="tspan88">På en dejlig lynggrund ligger dette store, </tspan><tspan
         
         y="12.996"
         id="tspan90">rustikke feriehus. Det er indrettet med i alt fire </tspan><tspan
         
         y="25.992001"
         id="tspan92">soveværelser, og derudover er der en hems med </tspan><tspan
         
         y="38.987999"
         id="tspan94">to sovepladser. Den hyggelige opholdsstue ligger </tspan><tspan
         
         y="51.984001"
         id="tspan96">i direkte forbindelse med køkken og spisestue. </tspan><tspan
         
         y="64.980003"
         id="tspan98">Stuen har store panoramavinduer, hvorfra der er </tspan><tspan
         
         y="77.975998"
         id="tspan100">udsigt til den smukke natur, og I får fornemmelsen </tspan><tspan
         
         y="90.972"
         id="tspan102">af, at naturen er lukket indenfor. I den ene ende </tspan><tspan
         
         y="103.968"
         id="tspan104">af huset er der swimmingpool, spabad og sauna. </tspan><tspan
         
         y="116.964"
         id="tspan106">På terrassen kan man sidde uforstyrret og nyde </tspan><tspan
         
         y="129.96001"
         id="tspan108">den friske luft. Der er ikke langt til vandland, </tspan><tspan
         
         y="142.95599"
         id="tspan110">tennisbaner og golfbane. Det er kun tilladt at </tspan><tspan
         
         y="155.952"
         id="tspan112">medbringe ét husdyr.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,74.416,278.8081)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text118"><tspan
         
         y="0"
         id="tspan116">Feriehus nr. 113</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,74.416,262.9734)"
       style="font-style:italic;font-variant:normal;font-weight:bold;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-BoldItalic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text122"><tspan
         
         y="0"
         id="tspan120">Bork Havn</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,74.416,249.9774)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text144"><tspan
         
         y="0"
         id="tspan124">Unikt hus med pool bygget i en flot, moderne stil </tspan><tspan
         
         y="12.996"
         id="tspan126">og indeholdende alt, hvad I skal bruge på ferien. </tspan><tspan
         
         y="25.992001"
         id="tspan128">Poolrummet rummer også en stor indendørs spa. </tspan><tspan
         
         y="38.987999"
         id="tspan130">Alle værelser er meget rummelige og har højt </tspan><tspan
         
         y="51.984001"
         id="tspan132">til loftet, og begge badeværelser er nye. Det </tspan><tspan
         
         y="64.980003"
         id="tspan134">velindrettede køkken-alrum med brændeovn </tspan><tspan
         
         y="77.975998"
         id="tspan136">indeholder alt i hårde hvidevarer. Husdyr er </tspan><tspan
         
         y="90.972"
         id="tspan138">tilladt. Området er kendt for gode surfmuligheder </tspan><tspan
         
         y="103.968"
         id="tspan140">i Ringkøbing Fjord og den lille, hyggelige havn. I </tspan><tspan
         
         y="116.964"
         id="tspan142">nærheden ligger der en børnevenlig strand. </tspan></text>
    <path
       d="M 332.369,753.858 H 581.318 V 541.26 H 332.369 Z m 0,-228.227 H 581.318 V 313.033 H 332.369 Z m 0,-229.319 H 581.318 V 83.714 H 332.369 Z"
       style="fill:#e9e9e9;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="path146" />
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,340.8727,736.3544)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text150"><tspan
         
         y="0"
         id="tspan148">Feriehus nr. 114</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,340.8727,720.5197)"
       style="font-style:italic;font-variant:normal;font-weight:bold;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-BoldItalic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text154"><tspan
         
         y="0"
         id="tspan152">Henne Strand</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,340.8727,707.5237)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text180"><tspan
         
         y="0"
         id="tspan156">Dejligt feriehus med spa samt sauna og en unik </tspan><tspan
         
         y="12.996"
         id="tspan158">beliggenhed ved Henne Strand. Det er på mange </tspan><tspan
         
         y="25.992001"
         id="tspan160">måder et praktisk hus, hvor der er tænkt på alle </tspan><tspan
         
         y="38.987999"
         id="tspan162">generationer. Til børnene er der bl.a. en god, </tspan><tspan
         
         y="51.984001"
         id="tspan164">lille hems, som kan bruges til legehule. Husdyr </tspan><tspan
         
         y="64.980003"
         id="tspan166">er tilladt. Husets indendørs poolafdeling kan ses </tspan><tspan
         
         y="77.975998"
         id="tspan168">fra stuen, så I kan holde øje med børnene. Henne </tspan><tspan
         
         y="90.972"
         id="tspan170">har et af Danmarks bedste naturområder, og </tspan><tspan
         
         y="103.968"
         id="tspan172">derudover er der både golf, ridning og vandreture </tspan><tspan

         y="129.96001"
         id="tspan176">Strand med restauranter, butikker samt vestkystens </tspan><tspan
         
         y="142.95599"
         id="tspan178">bedste badestrande ligger i gåafstand fra huset.</tspan></text>

    <text
       xml:space="preserve"

       id="text216"><tspan
         
         y="0"
         id="tspan190">Dette velholdte feriehus ligger i naturskønne </tspan><tspan

         y="25.992001"
         id="tspan194">Køkkenet ligger i åben forbindelse med spise- </tspan><tspan

         y="51.984001"

         y="64.980003"
         id="tspan200">dejlige soverum samt to flotte badeværelser. Den </tspan><tspan
         
         y="77.975998"
         id="tspan202">velmøblerede stue har brændeovn, som spreder </tspan><tspan
         
         y="90.972"
         id="tspan204">hygge og varme. Fra stuen kan I holde øje med </tspan><tspan
         
         y="103.968"
         id="tspan206">de badendes leg gennem glasdørene til det store </tspan><tspan
         
         y="116.964"
         id="tspan208">indendørs poolrum med både swimmingpool, </tspan><tspan
         
         y="129.96001"
         id="tspan210">sauna og spabad. Til huset hører også to dejlige </tspan><tspan
         
         y="142.95599"
         id="tspan212">terrasser, begge med halvmure til at skabe læ. </tspan><tspan

       id="text256"><tspan

         id="tspan250">huset. Nyd området på de anlagte stier på gåben, til </tspan><tspan
         
         y="77.975998"

         y="90.972"

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,329.9764,736.3544)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text166"><tspan
         
         y="0"
         id="tspan164">Feriehus nr. 120</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,329.9764,720.5197)"
       style="font-style:italic;font-variant:normal;font-weight:bold;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-BoldItalic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text170"><tspan
         
         y="0"
         id="tspan168">Nymindegab</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,329.9764,707.5237)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text194"><tspan
         
         y="0"
         id="tspan172">Dette feriehus med indendørs swimmingpool ligger </tspan><tspan
         
         y="12.996"
         id="tspan174">på en stor naturgrund grænsende op til Nyminde </tspan><tspan
         
         y="25.992001"
         id="tspan176">Klitplantage. Til huset hører en dejlig terrasse </tspan><tspan
         
         y="38.987999"
         id="tspan178">med gynge og sandkasse. Stuen er hyggeligt og </tspan><tspan
         
         y="51.984001"
         id="tspan180">personligt indrettet og har direkte udgang til </tspan><tspan
         
         y="64.980003"
         id="tspan182">terrassen samt en brændeovn, der luner på kølige </tspan><tspan
         
         y="77.975998"
         id="tspan184">dage. Bemærk, at husdyr ikke er tilladt. Oplev den </tspan><tspan
         
         y="90.972"
         id="tspan186">smukke natur rundt om fjorden på skønne gå- eller </tspan><tspan
         
         y="103.968"
         id="tspan188">cykelture. Hvis I er ivrige lystfiskere, kan I tage en </tspan><tspan
         
         y="116.964"
         id="tspan190">tur på havet med fiskekutter. Mulighederne er </tspan><tspan
         
         y="129.96001"
         id="tspan192">mange i denne dejlige del af Danmark.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,329.9764,509.5827)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text198"><tspan
         
         y="0"
         id="tspan196">Feriehus nr. 121</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,329.9764,493.748)"
       style="font-style:italic;font-variant:normal;font-weight:bold;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-BoldItalic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text202"><tspan
         
         y="0"
         id="tspan200">Vejers Strand</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,329.9764,480.752)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text230"><tspan
         
         y="0"
         id="tspan204">Pragtfuldt feriehus beliggende i yderste række på </tspan><tspan
         
         y="12.996"
         id="tspan206">en kuperet klitgrund meget tæt på Vesterhavet. </tspan><tspan
         
         y="25.992001"
         id="tspan208">Den fint dekorerede indendørs poolafdeling byder </tspan><tspan
         
         y="38.987999"
         id="tspan210">på en stor swimmingpool, spabad samt adgang til </tspan><tspan
         
         y="51.984001"
         id="tspan212">sauna og badeværelse. Huset er hyggeligt indrettet </tspan><tspan
         
         y="64.980003"
         id="tspan214">og tilladt for husdyr. Køkkenet ligger i åben </tspan><tspan
         
         y="77.975998"
         id="tspan216">forbindelse med den store spise- og opholdsstue </tspan><tspan
         
         y="90.972"
         id="tspan218">med brændeovn. På husets afskærmede terrasse </tspan><tspan
         
         y="103.968"
         id="tspan220">kan I slappe af med en kop kaffe, mens I tilbereder </tspan><tspan
         
         y="116.964"
         id="tspan222">et lækkert måltid mad på grillen. Der er gåafstand </tspan><tspan
         
         y="129.96001"
         id="tspan224">til Vejers by, hvor der bl.a. er et bolsjekogeri og et </tspan><tspan
         
         y="142.95599"
         id="tspan226">bageri. På den ene side af Vejers Strand er bilkørsel </tspan><tspan
         
         y="155.952"
         id="tspan228">tilladt, mens den anden del er bilfri.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,329.9764,280.2638)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text234"><tspan
         
         y="0"
         id="tspan232">Feriehus nr. 122</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,329.9764,264.4291)"
       style="font-style:italic;font-variant:normal;font-weight:bold;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-BoldItalic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text238"><tspan
         
         y="0"
         id="tspan236">Vester Husby</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,329.9764,251.4331)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text266"><tspan
         
         y="0"
         id="tspan240">Denne stråtækte idyl byder på de optimale </tspan><tspan
         
         y="12.996"
         id="tspan242">muligheder for såvel en afslappet som en aktiv </tspan><tspan
         
         y="25.992001"
         id="tspan244">ferie. Feriehuset ligger i et gammelt klit- og </tspan><tspan
         
         y="38.987999"
         id="tspan246">plantageområde med et rigt dyreliv. Egnen er </tspan><tspan
         
         y="51.984001"
         id="tspan248">perfekt til lange vandre-, løbe- eller cykelture på </tspan><tspan
         
         y="64.980003"
         id="tspan250">de afmærkede stier, der blandt andet fører ud til </tspan><tspan
         
         y="77.975998"
         id="tspan252">Vesterhavet. Har I ikke brugt alle kræfterne ude i </tspan><tspan
         
         y="90.972"
         id="tspan254">naturen, kan I tage en rask svømmetur i den store </tspan><tspan
         
         y="103.968"
         id="tspan256">indendørs swimmingpool. Der er også en børnepool. </tspan><tspan
         
         y="116.964"
         id="tspan258">Huset er moderne indrettet og velegnet til flere </tspan><tspan
         
         y="129.96001"
         id="tspan260">familier. På den store lukkede terrasse kan I altid </tspan><tspan
         
         y="142.95599"
         id="tspan262">finde læ, når I vil nyde solens varme stråler. Husdyr </tspan><tspan
         
         y="155.952"
         id="tspan264">er tilladt.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,374.8793,71.0307)"
       style="font-style:italic;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:Minion;-inkscape-font-specification:Minion-Italic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text270"><tspan
         
         y="0"
         id="tspan268">Kilde: www.novasol.dk/feriehuse (29.11.2019), redigeret.</tspan></text>

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,75.1082,722.6395)"
       style="font-style:italic;font-variant:normal;font-weight:bold;font-stretch:normal;font-size:11px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-BoldItalic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text118"><tspan
         
         y="0"
         id="tspan116">Solnedgangstur</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,75.1082,706.8048)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text140"><tspan
         
         y="0"
         id="tspan120">Vores turbåd tager jer med på en 2 timers hyggelig </tspan><tspan
         
         y="12.996"
         id="tspan122">aftentur på Limfjorden. Nyd det betagende landskab </tspan><tspan
         
         y="25.992001"
         id="tspan124">omkring Sallingsundbroen og det flotte område ved </tspan><tspan
         
         y="38.987999"
         id="tspan126">Legind Vejle set fra søsiden. </tspan><tspan
         
         y="51.984001"
         id="tspan128">Medbring evt. din egen madkurv. Øl, vand og vin </tspan><tspan
         
         y="64.980003"
         id="tspan130">skal købes ombord. </tspan><tspan
         
         y="77.975998"
         id="tspan132">Gæsterne, der stiger på ved Sallingsund Færgekro, </tspan><tspan
         
         y="90.972"
         id="tspan134">er velkomne til at tage med til Nykøbing, hvor de </tspan><tspan
         
         y="103.968"
         id="tspan136">kan tage bybussen tilbage til Sallingsund kl. 20.15 </tspan><tspan
         
         y="116.964"
         id="tspan138">gratis.</tspan></text>
    <text
       xml:space="preserve"

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,75.1082,507.2064)"
       style="font-style:italic;font-variant:normal;font-weight:bold;font-stretch:normal;font-size:11px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-BoldItalic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text148"><tspan
         
         y="0"
         id="tspan146">Sælsafari</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,75.1082,491.3718)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text172"><tspan
         
         y="0"
         id="tspan150">Det vrimler med sæler i Limfjorden. Man regner </tspan><tspan
         
         y="12.996"
         id="tspan152">med en bestand på 2.700 sæler, en stigning på intet </tspan><tspan
         
         y="25.992001"
         id="tspan154">mindre end 80 procent siden 2010. Mange af disse </tspan><tspan
         
         y="38.987999"
         id="tspan156">holder til på Blinderøn. Sælerne ligger som oftest </tspan><tspan
         
         y="51.984001"
         id="tspan158">i store grupper og lever på Blinderøn hele året. I </tspan><tspan
         
         y="64.980003"
         id="tspan160">tilfælde af højvande, hvor sælernes opholdssteder </tspan><tspan
         
         y="77.975998"
         id="tspan162">oversvømmes, sejles der en aftentur med mulighed </tspan><tspan
         
         y="90.972"
         id="tspan164">for at beundre de flotte molerskrænter. </tspan><tspan
         
         y="103.968"
         id="tspan166">Afgang fra Nykøbing Havn kl. 18.00, hjemkomst kl. </tspan><tspan
         
         y="116.964"
         id="tspan168">21.00. Aftensmad kan købes: Svinekam stegt som </tspan><tspan
         
         y="129.96001"
         id="tspan170">vildt med tilbehør, herefter æblekage.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,73.6909,315.7851)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:14px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text176"><tspan
         
         y="0"
         id="tspan174">Tur nr. 3</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,75.1082,291.7733)"
       style="font-style:italic;font-variant:normal;font-weight:bold;font-stretch:normal;font-size:11px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-BoldItalic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text180"><tspan
         
         y="0"
         id="tspan178">Ø-hop til Livø</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,75.1082,275.9387)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text200"><tspan
         
         y="0"
         id="tspan182">Sejl med til Livø. Den lille ø er bilfri, så den </tspan><tspan
         
         y="12.996"
         id="tspan184">indbyder til gode vandreture. Undervejs er der rig </tspan><tspan
         
         y="25.992001"
         id="tspan186">mulighed for at se sæler, specielt på den fredede og </tspan><tspan
         
         y="38.987999"
         id="tspan188">utilgængelige Livø Tap. </tspan><tspan
         
         y="51.984001"
         id="tspan190">Der bliver ca. 3 timers ophold på øen, og frokosten </tspan><tspan
         
         y="64.980003"
         id="tspan192">på Livø kan bestilles gennem Morsø Turistbureau. </tspan><tspan
         
         y="77.975998"
         id="tspan194">Man er også velkommen til selv at medbringe </tspan><tspan
         
         y="90.972"
         id="tspan196">frokostkurv. Det er muligt at hoppe af på Fur. Man </tspan><tspan
         
         y="103.968"
         id="tspan198">kan tage cykel/barnevogn med på turen for kr. 50,-. </tspan></text>

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,340.1476,746.6512)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:14px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text278"><tspan

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,341.5649,721.4114)"
       style="font-style:italic;font-variant:normal;font-weight:bold;font-stretch:normal;font-size:11px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-BoldItalic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text282"><tspan
         
         y="0"
         id="tspan280">Mors Rundt</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,341.5649,705.5768)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text306"><tspan
         
         y="0"
         id="tspan284">Turen rundt om Mors byder på enestående </tspan><tspan
         
         y="12.996"
         id="tspan286">naturscenerier. Landskabet skifter fra nord til syd. </tspan><tspan
         
         y="25.992001"
         id="tspan288">Fra det barske til det blide og fra lave strandenge </tspan><tspan
         
         y="38.987999"
         id="tspan290">til rå klinter, der rejser sig nærmest lodret op af </tspan><tspan
         
         y="51.984001"
         id="tspan292">fjorden. </tspan><tspan
         
         y="64.980003"
         id="tspan294">Frokostpausen holdes ved Øst Vildsund Gl. </tspan><tspan
         
         y="77.975998"
         id="tspan296">Færgekro. Frokosten kan bestilles hos Morsø </tspan><tspan
         
         y="90.972"
         id="tspan298">Turistbureau og består enten af stjerneskud eller </tspan><tspan
         
         y="103.968"
         id="tspan300">pariserbøf. Man er også velkommen til selv at </tspan><tspan
         
         y="116.964"
         id="tspan302">medbringe frokostkurv. Drikkevarer kan købes </tspan><tspan
         
         y="129.96001"
         id="tspan304">ombord. </tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,340.1476,531.1299)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:14px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text310"><tspan
         
         y="0"
         id="tspan308">Tur nr. 5</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,341.5649,507.1181)"
       style="font-style:italic;font-variant:normal;font-weight:bold;font-stretch:normal;font-size:11px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-BoldItalic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text314"><tspan
         
         y="0"
         id="tspan312">Fur Rundt</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,341.5649,491.2834)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text320"><tspan
         
         y="0"
         id="tspan316">Fur ligger i Limfjorden nord for Salling og er 22 </tspan><tspan
         
         y="12.996"
         id="tspan318">km</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,355.2924,480.9235)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:8px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text324"><tspan
         
         y="0"
         id="tspan322">2</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,359.7404,478.2834)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text346"><tspan
         
         y="0"
         id="tspan326">. </tspan><tspan
         
         y="12.996"
         id="tspan328">Nordfur er opbygget af aske og moler. Moleret </tspan><tspan
         
         y="25.992001"
         id="tspan330">består af døde kiselalger, der for 55 millioner år </tspan><tspan
         
         y="38.987999"
         id="tspan332">siden i enorme mængder blev aflejret i lag skiftevis </tspan><tspan
         
         y="51.984001"
         id="tspan334">med lag af aske fra vulkanudbrud. Oplev det </tspan><tspan
         
         y="64.980003"
         id="tspan336">uspolerede landskab fra søsiden – en fantastisk flot </tspan><tspan
         
         y="77.975998"
         id="tspan338">tur. </tspan><tspan
         
         y="90.972"
         id="tspan340">Kaffe med kage kan købes ombord.</tspan><tspan
         
         y="103.968"
         id="tspan342">Start evt. turen rundt om Fur fra Nykøbing Havn kl. </tspan><tspan
         
         y="116.964"
         id="tspan344">12.00. Båden er tilbage i Nykøbing kl. 17.45.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,340.1476,315.4892)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:14px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text350"><tspan
         
         y="0"
         id="tspan348">Tur nr. 6</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,340.1476,291.8967)"
       style="font-style:italic;font-variant:normal;font-weight:bold;font-stretch:normal;font-size:11px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-BoldItalic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text354"><tspan
         
         y="0"
         id="tspan352">Aftensejlads med jazzmusik</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,340.1476,276.062)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text372"><tspan
         
         y="0"
         id="tspan356">Tag på en 3 timers smuk sejltur på Limfjorden </tspan><tspan
         
         y="12.996"
         id="tspan358">krydret med jazzmusik. Nyd lyden, vandet og </tspan><tspan
         
         y="25.992001"
         id="tspan360">aftensolen i Limfjordens dejlige omgivelser </tspan><tspan
         
         y="38.987999"
         id="tspan362">akkompagneret af herlig jazz. Afgang fra Nykøbing </tspan><tspan
         
         y="51.984001"
         id="tspan364">Havn kl. 18.00, hjemkomst kl. 21.00. Du har </tspan><tspan
         
         y="64.980003"
         id="tspan366">mulighed for at nyde aftensmad på turen i den </tspan><tspan
         
         y="77.975998"
         id="tspan368">hyggelige salon fx varmrøget laks med blandet salat </tspan><tspan
         
         y="90.972"
         id="tspan370">og flutes for kun 99 kr. </tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,412.7147,140.5819)"
       style="font-style:italic;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:Minion;-inkscape-font-specification:Minion-Italic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text378"><tspan
         
         y="0"
         id="tspan374">Kilde: Mors 2019, Morsø Turistbureau, redigeret.</tspan><tspan
         
         y="10.998"
         id="tspan376">Kilde: www.visitnordjylland.dk (november 2019), uddrag.</tspan></text>

       id="text382"><tspan
         
         y="0"
         id="tspan380">Sejladser i Limfjorden</tspan></text>
